import { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [],
    };
  }

  componentDidMount() {
    fetch("https://jsonplaceholder.typicode.com/users").then((response) =>
      response.json().then((users) =>
        this.setState(
          () => {
            return {
              monsters: users,
            };
          },
          () => {
            console.log(monsters);
          }
        )
      )
    );
  }

  render() {
    return (
      <div className="App">
        {this.state.monsters.map(function (niggles) {
          return (
            <div key={niggles.id}>
              <h1>{niggles.name}</h1>
            </div>
          );
        })}
      </div>
    );
  }
}

export default App;
